import Link from 'next/link';
import MyLogo from './MyLogo';

const linkStyle = {
  marginRight: 200,
};
const Header = () => (
  <div>
    <MyLogo/>
    <Link href="/">
      <a className="home">Home</a>
    </Link>
    <Link href="/about">
      <a >About</a>
    </Link>
  </div>
);

export default Header;
